import React from 'react';

// import BrowserRouter, Route, and Link components
import { BrowserRouter, Route, Link } from 'react-router-dom';

// import components
import Preloader from './Preloader.js';

// import css files
import './style.css';
import './table.css';

function App() {
  return (
    <BrowserRouter>
      <div className="App">
        <Preloader></Preloader>
      </div>
    </BrowserRouter>
  );
}

export default App;
